import React from "react";
import { Container, Row, Col } from "reactstrap";

import me_pic from "../../images/me.jpg";
import "./About.css";
import Card from "../Card/Card";

const about = () => {
  console.log("Here in about");
  return (
    <div className="About">
      <div className="aboutContainer">
        <Container className="align-items-center">
          <Row>
            <Col className="col-md-6">
              <h2>Robert Selkirk Knox</h2>
              <img
                src={me_pic}
                alt="me"
                style={{ height: "350px", width: "250px" }}
              ></img>
              <p>
                Robert Selkirk Knox is a writer of crime fiction. After
                finishing school at UCSC, he lived in Barcelona for 5 years.
                Upton returning to the Bay Area he worked in the tech sector. He
                has written two novels. One about Barcelona in the late 80's and
                one about San Franciso, just after the Loma Prieta earthquake.
                Both books are thillers. He has lived in Spain, France, the
                United States and Brazil.
              </p>
            </Col>

            <Col className="col-md-6">Test 2</Col>
          </Row>
        </Container>
      </div>
    </div>
  );
};

export default about;
